import React from 'react'

const Navbtn = (props: any) => {
    return (
        <button className="px-3 py-2 mx-5 my-2 rounded hover:bg-gray-200 focus:outline-none" onClick={props.onClick}>{props.text}</button>
    )

}

const AppBar = () => {

  return (
    <div className="w-max bg-white ">
      {(
        <Navbtn text="provetta" onClick={() => {
          console.log("nel prosino")
        }}/>
      )}
    </div>
  )
}

export default AppBar;
